import Footer from '../Components/Footer';
import Structure from '../Components/'
function ShowPage()
{
    return(
        <div>
            <h1 className='meet-schedule'>Your Meeting Schedule </h1>
            <div className="show-detail">
                <h1>Your Detail</h1>
            </div>
            <Footer/>
        </div>
    );
}

export default ShowPage;
